export function CreateModuleDB(db){db.exec("\n        CREATE TABLE IF NOT EXISTS modules(\n            id INTEGER PRIMARY KEY AUTOINCREMENT,\n            name TEXT UNIQUE NOT NULL,\n            create_at DATEIME DEFAULT CURRENT_TIMESTAMP\n        )\n    ");const insertroles=db.prepare("INSERT INTO modules (name) VALUES (@name)");db.transaction((items=>{for(const item of items)insertroles.run(item)}))([{name:"media_manager"},{name:"product_manager"}])}